import { defineMessages } from 'react-intl';

export const scope = 'app.components.WorkshopDetails';

export default defineMessages({
  workshopDetails: {
    id: `${scope}.workshopDetails`,
    defaultMessage: 'Workshop Details',
  },
  name: {
    id: `${scope}.name`,
    defaultMessage: 'Workshop Name',
  },
  code: {
    id: `${scope}.code`,
    defaultMessage: 'Workshop Code',
  },
  workshopCodeRequired: {
    id: `${scope}.workshopCodeRequired`,
    defaultMessage: 'Workshop Code field is required.',
  },
  type: {
    id: `${scope}.type`,
    defaultMessage: 'Workshop Type',
  },
  workshopTypeRequired: {
    id: `${scope}.workshopTypeRequired`,
    defaultMessage: 'Workshop Type field is required.',
  },
  gstRequired: {
    id: `${scope}.gstRequired`,
    defaultMessage: 'GST field is required.',
  },

  startTime: {
    id: `${scope}.startTime`,
    defaultMessage: 'Start Time',
  },
  startTimeRequired: {
    id: `${scope}.startTimeRequired`,
    defaultMessage: 'Start Time field is required.',
  },

  endTime: {
    id: `${scope}.endTime`,
    defaultMessage: 'End Time',
  },
  endTimeRequired: {
    id: `${scope}.endTimeRequired`,
    defaultMessage: 'End Time field is required.',
  },

  workingDays: {
    id: `${scope}.workingDays`,
    defaultMessage: 'Working Days',
  },
  workingDaysRequired: {
    id: `${scope}.workingDaysRequired`,
    defaultMessage: 'Working Days field is required.',
  },

  workshopNameRequired: {
    id: `${scope}.workshopNameRequired`,
    defaultMessage: 'Workshop Name field is required.',
  },
  inChargeCode: {
    id: `${scope}.inChargeCode`,
    defaultMessage: 'In-Charge Code',
  },
  inChargeCodeRequired: {
    id: `${scope}.inChargeCodeRequired`,
    defaultMessage: 'In-Charge Code field is required.',
  },
  ro: {
    id: `${scope}.ro`,
    defaultMessage: 'RO',
  },
  roRequired: {
    id: `${scope}.roRequired`,
    defaultMessage: 'RO field is required.',
  },
  saveButtonLabel: {
    id: `${scope}.saveButtonLabel`,
    defaultMessage: 'Save & Next',
  },
  cancelButtonLabe: {
    id: `${scope}.cancelButtonLabe`,
    defaultMessage: 'Clear',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong`,
    defaultMessage: 'Something went wrong while saving Workshop Details.',
  },
  workshopDetailsSaveSuccess: {
    id: `${scope}.workshopDetailsSaveSuccess`,
    defaultMessage: 'Workshop Details was saved successfully.',
  },
  pan: {
    id: `${scope}.pan`,
    defaultMessage: 'PAN',
  },
  panInvalid: {
    id: `${scope}.panInvalid`,
    defaultMessage: 'Invalid Pan',
  },
  gstInvalid: {
    id: `${scope}.gstInvalid`,
    defaultMessage: 'GST must be 15 characters',
  },
  panRequired: {
    id: `${scope}.panRequired`,
    defaultMessage: 'Pan Field required',
  },
  gstin: {
    id: `${scope}.gstin`,
    defaultMessage: 'GST',
  },
});
